  const dataPrimary = [
    {
      data: 'Username',
      center: true,
    },
    {
      data: 'Color',
    },
    {
      data: 'Team',
      center: true,
    },
    {
      data: 'Figure',
    },
  ];

  const rowsData = [
    [
      {
