      {
        data: '#1',
        center: true,
      },
      {
        colorSpaceship: 'rgb(0,255,0)',
      },
    ],
    [
      {
        data: 'loooooooll2525',
        center: true,
      },
      {
        data: 'Infinity waves',
      },
      {
        data: '#1',
        center: true,
      },
      {
        colorSpaceship: 'rgb(255,255,0)',
      },
    ],
  ];

  return (
    <StyledRooms>
      <Header>
        <p
          style={{
            fontSize: '16px',
            fontWeight: 700,
            letterSpacing: '2px',
            marginLeft: '22px',
          }}
        >
          NEW GAME
        </p>
      </Header>
      <Container width="80%" style={{}}>
        <Table
          lineEveryRow
          widthCells={[20, 20, 20, 35]}
          dataPrimary={dataPrimary}
          rowsData={rowsData}
        />
      </Container>
      <Button
        onClick={() => {
          router.push('/lobby');
        }}
        style={{
          right: '28px',
          bottom: '22px',
        }}
      >
        Leave
      </Button>
      <Button
        onClick={() => {
          router.push('/lobby');
        }}
        style={{
          right: '28px',
          bottom: '22px',
        }}
      >
        Create new game
      </Button>
    </StyledRooms>
  );
};

export default Rooms;
